import coingif from '../assets/coin.gif'
import background from '../assets/background.jpeg'

const Coin = () => {
    return (
        <div className="container" style={
            {
                backgroundImage: `url(${coingif})`,
            }
        }>
            <div className="chooser">
                <div className="coin">
                    <h1 className='title'>Coin chooser</h1>
                    <img src={coingif} alt="coin" className='coingif'/>
                    <button className=''>Choose</button>
                </div>
            </div>
        </div>
    )
}
export default Coin
